package song.common.toolkit.base;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import java.util.Date;/** * description: * author:          song * createDate:      2018/4/13 */public class IdModel<T> extends BaseModel {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    protected T id;    public T getId() {        return id;    }    public void setId(T id) {        this.id = id;    }    protected  String createUser;    protected Date createTime;    protected  String lastUpdateUser;    protected Date lastUpdateTime;    public String getCreateUser() {        return createUser;    }    public void setCreateUser(String createUser) {        this.createUser = createUser;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getLastUpdateUser() {        return lastUpdateUser;    }    public void setLastUpdateUser(String lastUpdateUser) {        this.lastUpdateUser = lastUpdateUser;    }    public Date getLastUpdateTime() {        return lastUpdateTime;    }    public void setLastUpdateTime(Date lastUpdateTime) {        this.lastUpdateTime = lastUpdateTime;    }}